import React from "react";



class StarWars extends React.Component{
//create state
//create a constructor

    constructor(){
        super()
        this.state={
            name:null,
            height:null,
            mass:null,
            homeworld:null,
            films:[],
        }        

    }
   

    generateCharacter(){
        console.log("this works")
        this.setState={
            name:this.state
        }

    }
   
    render(){
        return (
        <div>
            <h1>Name</h1>
            <p>Height cm</p>
            <p>Mass kg</p>
            <p>Homeworld: Url</p>
            <ul>Films
                <li>Films in here</li>  
            </ul>
            <button type="button"
            onClick={()=> this.generateCharacter()} 
            className="btn" >
                Randomize Character
            </button>

        </div>)
    }

}


export default StarWars;
